import Header from "../components/Header/Header";
import Navbar from "../components/Navbar/Navbar";
import MainSection from "../components/MainSection/MainSection";
import Button from "../components/Button/Button";
import HireOurTeam from "../components/HireOurTeam/HireOurTeam";
import HireOurTeamCss from "../components/HireOurTeam/HireOurTeam.css";
import WhatWeDo from "../components/WhatWeDo/WhatWeDo";
import WhatWeDoCss from "../components/WhatWeDo/WhatWeDo.css";
import FoundingWebDevs from "../components/FoundingWebDevs/FoundingWebDevs";
import FoundingWebDevsCss from "../components/FoundingWebDevs/FoundingWebDevs.css";
import Head from "next/head";
import App from "../components/App/App.js";

const Index = () => (
  <div>
    <Head>
      <title>
        Chiedo Labs: Custom Web Development - Node.js | React | Rails | PHP
      </title>
      <meta
        name="viewport"
        content="minimum-scale=1, initial-scale=1, width=device-width, shrink-to-fit=no"
      />
    </Head>
    <style jsx global>{`
      body {
        font-family: "Open Sans", sans-serif;
        color: #2c343b;
        background-color: #f2f2f2;
        boxsizing: "border-box";
      }
    `}</style>
    <Header imageUrl="https://labs.chiedo.com/wp-content/themes/chiedolabs/img/b-logo-white.png?ver=1.11" />

    <Navbar />
    <MainSection
      tagline={
        <div>
          Your New
          <br />
          Web Developers
        </div>
      }
      description="Weâ€™re a team of web developers passionate about building stable, maintainable software for tech startups and enterprise customers."
    />
    <HireOurTeam
      classNames={`${HireOurTeamCss.FullWidth} ${HireOurTeamCss.hireOurTeam}`}
    />
    <WhatWeDo 
    titleFirstWord="WHAT" 
    restOfTitle="WE D0" 
    flexClass={WhatWeDoCss.flexNormal}
    restOfText={
        <React.Fragment>
            <p className={WhatWeDoCss.paragraph}>We build and maintain:</p>
            <p className={WhatWeDoCss.paragraph}>Web Front-ends with HTML, CSS, and a library called React.</p>
            <p className={WhatWeDoCss.paragraph}>Web Back-ends using NodeJS, Ruby on Rails, PHP, MySQL, AWS, and Heroku.</p>
            <p className={WhatWeDoCss.paragraph}>Custom Websites from the ground up as opposed to using pre-existing templates.</p>
        </React.Fragment>
    }
    />
    <FoundingWebDevs />
    <WhatWeDo
      style={{ flexDirection: "row-reverse" }}
      titleFirstWord="WHO"
      restOfTitle="WE SERVE"
      flexClass={WhatWeDoCss.flexReverse}
    />
  </div>
);

export default Index;
